class ProjectListRemindRequestModel {  int? manageProjectId;  String? page;  String? createdAt;  String? dateRemind;  ProjectListRemindRequestModel(      {this.manageProjectId, this.page, this.createdAt, this.dateRemind});  ProjectListRemindRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['manage_project_id'];    page = json['page'];    createdAt = json['created_at'];    dateRemind = json['date_remind'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_id'] = this.manageProjectId;    data['page'] = this.page;    data['created_at'] = this.createdAt;    data['date_remind'] = this.dateRemind;    return data;  }}